import React, { useEffect, useState } from 'react';
import axios from 'axios';

function BoardList() {
    const [boards, setBoards] = useState([
        {id:1, title:"내용1"},
        {id:2, title:"내용2"},
        {id:3, title:"내용3"},
        {id:4, title:"내용4"},
    ]);
    return(
    //보드 내용
    <ul>
        <li>
            {boards.map((post) => (
                <div>
                    번호 : {post.id} 제목{post.title}
                </div>
            ))}
        </li>
    </ul>
    // 페이징
    )
}
export default BoardList;
